// src/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import {
  LineChart,
  Line,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  BarChart,
  Bar,
  ResponsiveContainer,
  Legend
} from 'recharts';
import './AdminDashboard.css';

function AdminDashboard() {
  const [girisData, setGirisData] = useState([]);
  const [cikisData, setCikisData] = useState([]);
  const [kazancData, setKazancData] = useState([]);
  const [enCokKalanlar, setEnCokKalanlar] = useState([]);
  const [aktifAraclar, setAktifAraclar] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchAllReports = async () => {
      try {
        const [girisRes, cikisRes, kazancRes, kalanlarRes, aktifRes] = await Promise.all([
          fetch('/api/report/haftalik-giris'),
          fetch('/api/report/haftalik-cikis'),
          fetch('/api/report/haftalik-kazanc'),
          fetch('/api/report/en-cok-kalanlar'),
          fetch('/api/report/aktif-araclar')
        ]);

        setGirisData(await girisRes.json());
        setCikisData(await cikisRes.json());
        setKazancData(await kazancRes.json());
        setEnCokKalanlar(await kalanlarRes.json());
        setAktifAraclar(await aktifRes.json());
      } catch (err) {
        console.error('Veri çekme hatası:', err);
        setError('Rapor verileri yüklenemedi.');
      }
    };

    fetchAllReports();
  }, []);

  return (
    <div className="admin-reports-container">
      <h2>Haftalık Raporlar</h2>
      {error && <p className="admin-reports-error">{error}</p>}

      <div className="admin-reports-charts">
        <div className="chart-box">
          <h3>Günlük Giriş Sayıları</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={girisData}>
              <Line type="monotone" dataKey="sayi" stroke="#007bff" />
              <CartesianGrid stroke="#ccc" />
              <XAxis dataKey="gun" />
              <YAxis />
              <Tooltip />
            </LineChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-box">
          <h3>Günlük Çıkış Sayıları</h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={cikisData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="gun" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="sayi" fill="#28a745" />
            </BarChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-box">
          <h3>Günlük Kazanç (TL)</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={kazancData}>
              <Line type="monotone" dataKey="toplam" stroke="#ffc107" />
              <CartesianGrid stroke="#ccc" />
              <XAxis dataKey="gun" />
              <YAxis />
              <Tooltip />
              <Legend />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>

      <div className="admin-reports-tables">
        <div className="table-section">
          <h3>Otoparkta En Uzun Süre Kalan 5 Araç</h3>
          <table>
            <thead>
              <tr>
                <th>Plaka</th>
                <th>Süre (dk)</th>
              </tr>
            </thead>
            <tbody>
              {enCokKalanlar.map((arac, idx) => (
                <tr key={idx}>
                  <td>{arac.arac_plaka}</td>
                  <td>{arac.sure}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        <div className="table-section">
          <h3>Şu An Otoparkta Bulunan Araçlar</h3>
          <table>
            <thead>
              <tr>
                <th>Plaka</th>
                <th>Giriş Saati</th>
              </tr>
            </thead>
            <tbody>
              {aktifAraclar.map((arac, idx) => (
                <tr key={idx}>
                  <td>{arac.arac_plaka}</td>
                  <td>{new Date(arac.giris_saat).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
